import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'
import './App.css'
import AppNavbar from './components/AppNavbar2';
import Carousel1 from './components/Carousel';
import ShoppingList from './components/ShoppingList';
import ItemModel from './components/itemModel';
import addItem from './components/addItem';
import map from './components/map';
import itemDetails from './components/itemDetails'
import {Carousel, Container} from 'reactstrap';
import {Provider} from'react-redux';
import store from './store';
import {loadUser} from './actions/authActions';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import '@fortawesome/fontawesome-free/css/all.min.css';
import 'bootstrap-css-only/css/bootstrap.min.css';
import 'mdbreact/dist/css/mdb.css';
import BlogPage from './components/CarouselPage.js';




class App extends Component {
  componentDidMount(){
    store.dispatch(loadUser());
  }
  render(){
  return (
    <Provider store={store}>
      <div style={{backgroundColor:'#F0EBEA'}}>
      <Container>
    <Router>
      <AppNavbar/>
        {/* <Route path="/" exact component={map}/> */}
      <Route path="/" exact component={Carousel1}/>
      <Route path="/addItem" exact component={addItem}/>
      <Route path="/searchItem" exact component={ShoppingList}/>
      <Route path="/searchItem/:id" exact component={itemDetails}/>
    </Router>
    </Container>
    </div>
    </Provider>
  );
}
}
export default App;
